import React, { Component } from "react";
import { connect } from "react-redux";
import "./Login.css";
class Login extends Component {
  constructor(props) {
    super(props);
    this.state = {
      email: "",
      passowrd: "",
    };
  }
  handleOnChange = e => {
      this.setState({
          [e.target.name]: e.target.value
      })
  }
  render() {
    return (
      <div>
        <>
          <legend>Form title</legend>

          <div class="form-group">
            <label for="">email</label>
            <input onChange={this.handleOnChange} name="email" type="text" placeholder="email field" />
          </div>
          <div class="form-group">
            <label for="">password</label>
            <input onChange={this.handleOnChange} name="password" type="text" placeholder="password field" />
          </div>
          <button type="submit" class="btn btn-primary">
            LOGIN
          </button>
        </>
      </div>
    );
  }
}
export default connect()(Login);
